<div style="padding: 14px">
  <header motif-header>
    <button
      motif-header-menu
      (click)="toggleShowMenu()"
      [isOpen]="false"
      position="left"
      aria-label="Toggle menu"
    ></button>
    <img
      motif-header-logo
      alt="Product name"
      src="assets/images/ey-logo-black.png"
      position="left"
    />
    <!-- <button motif-header-avatar position="left" aria-label="Avatar">
      < motif-avatar  className="undefined"
      size="medium"
></motif-avatar>
    </button> -->




    <span motif-header-title position="left">InsurProdX</span>
    <motif-form-field position="right">
      <input
        motifInput
        motifSearch
        type="text"
        placeholder="Search..."
        aria-label="Search"
        [(ngModel)]="model"
        [motifTypeahead]="motifTypeahead"
      />
    </motif-form-field>
    <button
      motif-header-icon
      position="right"
      (click)="selected = !selected"
      aria-label="Toggle search"
    >
      <motif-icon
        [iconFunction]="search()"
        strokeWidth="2"
        fill="none"
        size="24"
      ></motif-icon>
    </button>
    <button
      motif-header-icon
      position="right"
      (click)="selected = !selected"
      aria-label="Show notifications"
    >
      <motif-icon [iconFunction]="bell()" strokeWidth="2" fill="none" size="24">
        <!-- <motif-badge  type="info-alt" ></motif-badge> -->
      </motif-icon>
    </button>
    <button
      motif-header-icon
      position="right"
      (click)="selected = !selected"
      aria-label="Help"
    >
      <motif-icon
        [iconFunction]="helpCircle()"
        strokeWidth="2"
        fill="none"
        size="24"
      ></motif-icon>
    </button>
    <button
      motif-header-icon
      position="right"
      [selected]="false"
      (click)="selected = !selected"
      aria-label="Settings"
    >
      <motif-icon
        [iconFunction]="settings()"
        strokeWidth="2"
        fill="none"
        size="24"
      ></motif-icon>
    </button>
    <button
      motif-header-icon
      position="right"
      (click)="selected = !selected"
      aria-label="more Button"
    >
      <motif-icon
        [iconFunction]="moreHoriz()"
        strokeWidth="2"
        fill="none"
        size="24"
      ></motif-icon>
    </button>
